import './index.css'
// import {DataProvider} from './Components/KitchenManager/GlobalStateKM'

 

function App() {

  return (
    <DataProvider>
 
      <Router>
        <div className="App">
 
          <UserSideBar />
          {/* <SideBar/> */}
 
          <div className="mainPages">
              <Pages />
            </div>
        </div>
      </Router>
 
 
 
    </DataProvider>
  );
} 
      
export default App;
